import React from 'react';

const NavBar = () => {
  return (
    <div class="Navbar">
    <div class="body">
        <h1>Home</h1>
    </div>
    <div class="main">
        <div class="second-body">
            <div class="thing">
                <span class="dot-2-left"></span> <span class="dot-left"></span> <h3> Sports </h3> <span class="dot-right"></span> <span class="dot-2-right"></span> 
            </div>
            <div class="thing">
                <span class="dot-2-left"></span> <span class="dot-left"></span> <h3> Accessories </h3> <span class="dot-right"></span> <span class="dot-2-right"></span>
               </div>
               <div class="thing">
                <span class="dot-2-left"></span> <span class="dot-left"></span> <h3> Cinemas </h3> <span class="dot-right"></span> <span class="dot-2-right"></span>
               </div>
        </div>
    </div>
    </div>
  );
};

export default NavBar;
